import React from 'react';

export default function CountryNavigation() {
	return (
		<div className="my-10  flex justify-start">
			<a
				href="/"
				className="border border-elements rounded-md h-12 bg-elements"
			>
				<div>
					<img src="arrow-back-light-icon.svg" alt="arrow-back" />
				</div>
				<div>
					<span>Back</span>
				</div>
			</a>
		</div>
	);
}
